import './HomePage.scss';

const HomePage = () => {
  return (
    <div className='homepage'>
      <div className='homepage__header'>
        <Header />
        <div className='homepage__header_content'>
          <div className='homepage__header_content_title'>

          </div>
        </div>
      </div>
    </div>
  )
}

export default HomePage;
